-- table for interface p2p addresses, /127

CREATE TABLE base (
    base_prefix varchar UNIQUE NOT NULL,
    p2p_allocated INTEGER NOT NULL,
    delegated_allocated INTEGER NOT NULL
  );

CREATE TABLE p2p (
  prefix varchar UNIQUE NOT NULL,
  client_id INTEGER,
  released BOOLEAN NOT NULL,
  changed_at timestamp default current_timestamp
);

CREATE TABLE delegated (
  prefix varchar UNIQUE NOT NULL,
  client_id INTEGER,
  released BOOLEAN NOT NULL,
  changed_at timestamp default current_timestamp
);
-- status: released, acquired

CREATE INDEX base_prefix ON base (base_prefix); 
CREATE INDEX p2p_prefix ON p2p (prefix); 
CREATE INDEX delegated_prefix ON delegated (prefix);

